        >
            <Grid item xs={2}>
                <Sidebar setMode={setMode} mode={mode} />
            </Grid>
            <Grid item xs={7}>
                <Feed />
            </Grid>
            <Grid item xs={2}>

            </Grid>
        </Grid>

    );
};

export default Profile;
